import React from "react";
import PageHeader from "../Components/common/PageHeader";
import BBGlow from "../Components/quarries/BBGlow";

function BBGlowPage() {
  return (
    <>
      <PageHeader title="BB Glow" />
      <BBGlow />
    </>
  );
}

export default BBGlowPage;
